pr_body:
this PR allows us to do something as below
```js
  let texty = createText('Ampere Circulation Law');
  texty.position(25, 175);
  texty.fill('red');
  texty.size(35);
  texty.play();
  //play(texty); //can use this also
```
[open in web-editor](https://editor.p5js.org/radium.scientist/sketches/GzOX2Vz37)
## TL;DR
- [x] createText function
- [x] methods : `.play()`, `.size()` , `.fill()` and `.position()`

